import React from "react";
import Layout from "../components/Layout";

const About = () => {
  return (
    <div>
      <Layout>
        <div className="aboutContainer">
          <img
            className="Pic"
            src={`${process.env.PUBLIC_URL}/lola.jpeg`}
            style={{
              width: "50%",
              height: "100px",
            }}
            alt="Avatar"
          />
        </div>
      </Layout>
    </div>
  );
};

export default About;
